import React from 'react';
import { Form, Button, Card, Row, Col } from 'react-bootstrap';

const QueryForm = ({ query, tableIndex, queryIndex, formData, setFormData }) => {
  const queryTypes = ['SQL', 'PYTHON'];

  const isQueryOrderUnique = (order) => {
    return !formData.ReportName.tables.some((table, tIndex) => 
      table.query.some((q, qIndex) => 
        tIndex === tableIndex && qIndex === queryIndex 
          ? false 
          : q.QueryOrder === order
      )
    );
  };

  const handleQueryTypeChange = (e) => {
    const newTables = [...formData.ReportName.tables];
    newTables[tableIndex].query[queryIndex] = {
      ...newTables[tableIndex].query[queryIndex],
      queryType: e.target.value
    };
    setFormData({
      ...formData,
      ReportName: {
        ...formData.ReportName,
        tables: newTables
      }
    });
  };

  const handleQueryNameChange = (e) => {
    const newTables = [...formData.ReportName.tables];
    newTables[tableIndex].query[queryIndex] = {
      ...newTables[tableIndex].query[queryIndex],
      QueryName: e.target.value
    };
    setFormData({
      ...formData,
      ReportName: {
        ...formData.ReportName,
        tables: newTables
      }
    });
  };

  const handleQueryOrderChange = (e) => {
    const order = e.target.value;
    if (!isQueryOrderUnique(order)) {
      alert('Query order must be unique across all queries');
      return;
    }

    const newTables = [...formData.ReportName.tables];
    newTables[tableIndex].query[queryIndex] = {
      ...newTables[tableIndex].query[queryIndex],
      QueryOrder: order
    };
    setFormData({
      ...formData,
      ReportName: {
        ...formData.ReportName,
        tables: newTables
      }
    });
  };

  const handleQueryFileNameChange = (e) => {
    const newTables = [...formData.ReportName.tables];
    newTables[tableIndex].query[queryIndex] = {
      ...newTables[tableIndex].query[queryIndex],
      QueryFileName: e.target.value
    };
    setFormData({
      ...formData,
      ReportName: {
        ...formData.ReportName,
        tables: newTables
      }
    });
  };

  const handleQueryParameterChange = (e) => {
    const newTables = [...formData.ReportName.tables];
    const [key, value] = e.target.value.split(':').map(s => s.trim());
    if (!key || !value) return;

    newTables[tableIndex].query[queryIndex] = {
      ...newTables[tableIndex].query[queryIndex],
      queryParameter: {
        ...newTables[tableIndex].query[queryIndex].queryParameter,
        [key]: value
      }
    };
    setFormData({
      ...formData,
      ReportName: {
        ...formData.ReportName,
        tables: newTables
      }
    });
  };

  const handleRemoveQuery = () => {
    const newTables = [...formData.ReportName.tables];
    newTables[tableIndex].query = newTables[tableIndex].query.filter((_, i) => i !== queryIndex);
    setFormData({
      ...formData,
      ReportName: {
        ...formData.ReportName,
        tables: newTables
      }
    });
  };

  return (
    <Card className="mb-3">
      <Card.Body>
        <Row className="mb-3">
          <Col>
            <Form.Group>
              <Form.Label>Query Type</Form.Label>
              <Form.Select
                value={query.queryType}
                onChange={handleQueryTypeChange}
                required
              >
                {queryTypes.map(type => (
                  <option key={type} value={type}>{type}</option>
                ))}
              </Form.Select>
            </Form.Group>
          </Col>
          <Col>
            <Form.Group>
              <Form.Label>Query Name</Form.Label>
              <Form.Control
                type="text"
                value={query.QueryName}
                onChange={handleQueryNameChange}
                required
              />
            </Form.Group>
          </Col>
        </Row>

        <Row className="mb-3">
          <Col>
            <Form.Group>
              <Form.Label>Query Order</Form.Label>
              <Form.Control
                type="number"
                value={query.QueryOrder}
                onChange={handleQueryOrderChange}
                required
                min="1"
              />
            </Form.Group>
          </Col>
          <Col>
            <Form.Group>
              <Form.Label>Query File Name</Form.Label>
              <Form.Control
                type="text"
                value={query.QueryFileName}
                onChange={handleQueryFileNameChange}
                required
              />
            </Form.Group>
          </Col>
        </Row>

        <Row className="mb-3">
          <Col>
            <Form.Group>
              <Form.Label>Query Parameters (key: value)</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter parameters in format: key: value"
                onChange={handleQueryParameterChange}
              />
            </Form.Group>
          </Col>
        </Row>

        <Button
          variant="danger"
          onClick={handleRemoveQuery}
          className="mt-2"
        >
          Remove Query
        </Button>
      </Card.Body>
    </Card>
  );
};

export default QueryForm;
